import './App.css';
import './index.css';
import LoginForm from './LoginForm'
import DogBreed from ''
import { BrowserRouter, Routes, Route } from 'react-router-dom'



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path="/login" element={<LoginForm/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}
   

export default App;
